import styles from "./Result.module.css";
// import resultEngine from "../../../assets/ResultEngine.png";
// import resultDialog from "../../../assets/ResultDialog.png";
import Maintitle from "../../../assets/MainTitle.png";
import Printer from "../../../assets/Printer.png";
import Flags from "../../../assets/Flags.png";

const Result = () => {
  return (
    <>
      <div className={styles.backGroundImg} />
      <main>
        <div className={styles.topTitle}>
          <div className={styles.Subtitle}>당신의 개발자 성향은?</div>
          <div className={styles.Maintitle}>프론트엔드 개발자</div>
          <img
            src={Maintitle}
            alt="메인 타이틀입니다."
            className={styles.mainTitleBox}
          />
        </div>
        {/* <div className={styles.titleBox}>
          <div className={styles.titleContent}>
            눈에 보이는 화면을 개발하는 프론트엔드. 디자이너, PM, 백엔드
            사이에서 구체적인 요구사항을 표현합니다. 보다 나은 사용자 경험(UX)를
            위해 개발합니다.
          </div>
        </div>
        <div className={styles.contentBox}>
          <div className={styles.printBox}>
            <img
              src={Printer}
              alt="프린터 이미지입니다."
              className={styles.printer}
            />
          </div>
          <div className={styles.etcBox}>
            <img
              src={Flags}
              alt="깃발 이미지입니다."
              className={styles.Flags}
            />
          </div>
        </div> */}
      </main>
    </>
  );
};

export default Result;
